  \"Clarence Cannon National Wildlife Refuge & the Delair Division of the Mark Twain
  National Wildlife Refuge Complex : Contaminants survey results\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 17,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:48.281324\",\n\t\"name\": \"clarence-cannon-national-wildlife-refuge-the-delair-division-of-the-mark-twain-national-wi\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Fish and sediments were collected from
  Clarence Cannon National Wildlife Refuge (Clarence Cannon) and the Delair Division,
  both of the Mark Twain National Wildlife Refuge Complex, to determine if metal or
  organic contaminants were elevated in the biota located on the refuge. Whole fish
  and sediment samples were analyzed, results were compared to the literature, and
  potential contaminant problems were recognized. Metal residue concentrations of
  copper, iron, manganese, and zinc found in the fish samples were comparable or greater
  than concentrations in fish collected from known contaminated areas. However, the
  limited number of samples collected at the refuge areas and differing tissue types
  analyzed may demonstrate the reason for the apparent concentrations of concern.
  Sediment metal residue concentrations of arsenic, barium, chromium, copper, iron,
  manganese, nickel and zinc were in the ranges of moderately polluted to heavily
  polluted compared to EPA sediment guidelines. Even though these metal residue concentrations
  are above established guidelines, the significance of the data are difficult to
  interpret due to the lack of information needed to establish if the metals found
  in the refuge sediments are bioavailable to plants and animals and due to an inadequate
  sampling design. Further investigations should be initiated to determine the significance
  of the metal residues found in the biota and sediments collected from Clarence Cannon
  and the Delair Division of the Mark Twain National Wildlife Refuge Complex. The
  information obtained would allow the land manager to make a decision to initiate
  remedial activities, change the land management, or conduct more detailed studies
  of the potential problems.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
